window.bookSummaryJSON = "<p>For as long as I can remember, I’ve had to hide who I am. What I am. </p> <p>They had me play the sheep. They had me blend in. They marked me and sealed my power. </p> <p>Now I have my freedom, because everyone who’s ever wanted me confined is dead. </p> <p>I could have changed it. I could have altered the course of fate. I could have saved the unseelie queen. </p> <p>I didn’t. </p> <p>Vlari has always known her place: as far away from court as the unseelie queen can send her. </p> <p>The youngest royal, born in an impoverished household, she endeavored to earn her keep as an assistant and stay out of trouble. </p> <p>Dark, striking, and with a hidden agenda, Drusk definitely qualifies as trouble, but he refuses to leave her alone, clashing with her at every corner. </p> <p>Then the world implodes around her. </p> <p>With friends and foe by her side, she can fade with rest of the unseelie kingdom, or protect a court that has never cared for her. </p> <p>Disclaimer: Unlike many of May Sage’s novels, <i>Wicked Court</i> is written in first person.</p> <p><i>Wicked Court</i> is the first volume in a duet.</p>"; 
